import React from 'react';
import SortControls from '../SortControls/SortControls';
import useSortAndFilter from '../SortControls/useSortAndFilter';

const FilterBar = ({ onFilter, onSort }) => {
    const { filters, handleFilterChange } = useSortAndFilter(onSort, onFilter);

    return (
        <div className="filter-bar">
            <input type="text" name="characterRole" placeholder="Character Role" onChange={handleFilterChange} />
            <input type="text" name="guildRole" placeholder="Guild Role" onChange={handleFilterChange} />
            <input type="text" name="mainArchetype" placeholder="Main Archetype" onChange={handleFilterChange} />
            <input type="text" name="secondaryArchetype" placeholder="Secondary Archetype" onChange={handleFilterChange} />
            <input type="text" name="grandmasterProfession1" placeholder="Grandmaster Profession One" onChange={handleFilterChange} />
            <input type="text" name="grandmasterProfession2" placeholder="Grandmaster Profession Two" onChange={handleFilterChange} />
            <input type="number" name="minLevel" placeholder="Min Level" onChange={handleFilterChange} />
            <input type="number" name="maxLevel" placeholder="Max Level" onChange={handleFilterChange} />
            <input type="number" name="minItemLevel" placeholder="Min iLvl" onChange={handleFilterChange} />
            <input type="number" name="maxItemLevel" placeholder="Max iLvl" onChange={handleFilterChange} />
            <SortControls onSort={onSort} />
        </div>
    );
};

export default FilterBar;
